description:
Well it's that time of year again. You know, go to a photo studio and take some lame self portraits to send to grandma and grandpa showing them how much you've grown, but before you get disappointed about how much it will suck, take a step into our photo studio.
It is definitely better than the rest. How about 100% naked lesbian action going on when the cameras come out. So hot we don't even need flashbulbs. Ready! Aim! Shoot! Thank you for visiting the lesbian photo studio, come back soon!!!

Cast: Viktorie, Michelle, Daniela,  Sandra Sanchez, Romina, Angeli,  Charlie, Patricia


